-- ----------------------------
-- Table structure for `bcsupg_client_pay_privileges`
-- ----------------------------
DROP TABLE IF EXISTS `bcsupg_client_pay_privileges`;
CREATE TABLE `bcsupg_client_pay_privileges` (
  `ID` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `CLIENT_ID` int(10) NOT NULL COMMENT '客户端ID',
  `SERVICE_ID` int(10) NOT NULL COMMENT '服务标识',
  `PUBLIC_KEY` varchar(500) DEFAULT NULL COMMENT '客户端公钥',
  `START_DATE` datetime DEFAULT NULL,
  `END_DATE` datetime DEFAULT NULL,
  `ADD_DATE` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8 COMMENT='客户端权限表';

