-- ----------------------------
-- Table structure for `bcsupg_pay_interface`
-- ----------------------------
DROP TABLE IF EXISTS `bcsupg_pay_interface`;
CREATE TABLE `bcsupg_pay_interface` (
  `PAYWAY_ID` int(10) NOT NULL AUTO_INCREMENT COMMENT '支付通道',
  `PAYWAY_NAME` varchar(255) NOT NULL COMMENT '支付通道名称',
  `PAY_INTERFACE_URL` varchar(254) NOT NULL COMMENT '支付接口地址',
  `RECEIVE_ACCOUNT` varchar(50) NOT NULL COMMENT '收款账号',
  `PARTNER_ID` varchar(255) NOT NULL COMMENT '商户号',
  `KEY_TYPE` int(4) NOT NULL COMMENT '私钥类型：1）证书，2）字符串',
  `CERT_PATH1` varchar(254) NOT NULL COMMENT '第1证书路径',
  `CERT_PATH2` varchar(254) DEFAULT NULL COMMENT '第2证书路径',
  `USER_KEY` varchar(500) NOT NULL COMMENT '私钥',
  `PAY_PROCESS_CLASS` varchar(255) NOT NULL COMMENT '支付处理类',
  `STATUS` int(4) NOT NULL COMMENT '状态：1）有效，2）无效，99）注销',
  `RETURN_URL` varchar(255) DEFAULT NULL COMMENT '返回URL',
  `NOTIFY_URL` varchar(255) DEFAULT NULL COMMENT '通知URL',
  `ERROR_NOTIFY_URL` varchar(255) DEFAULT NULL COMMENT '失败通知URL',
  PRIMARY KEY (`PAYWAY_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2015 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of bcsupg_pay_interface
-- ----------------------------

-- ----------------------------
-- Table structure for `bcsupg_pay_records`
-- ----------------------------
DROP TABLE IF EXISTS `bcsupg_pay_records`;
CREATE TABLE `bcsupg_pay_records` (
  `RECORDS_ID` int(10) NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `OPT_SN` varchar(80) NOT NULL COMMENT '流水号',
  `SERVICE_ID` int(10) NOT NULL COMMENT '服务标识',
  `CLIENT_ID` int(10) NOT NULL COMMENT '客户端ID',
  `SIGN_TYPE` varchar(10) NOT NULL COMMENT '签名加密方式：MD5，RAS',
  `SIGN_DATA` varchar(255) NOT NULL COMMENT '签名数据',
  `BIZ_BACK_PARAMS` varchar(254) DEFAULT NULL COMMENT '业务回传参数',
  `RETURN_URL` varchar(200) NOT NULL COMMENT '消息通知地址',
  `NOTIFY_URL` varchar(200) NOT NULL COMMENT '返回地址',
  `ERROR_NOTIFY_URL` varchar(200) DEFAULT NULL COMMENT '请求出错返回地址',
  `TRADE_SN` varchar(50) NOT NULL COMMENT '交易流水号',
  `TRADE_DESC` varchar(254) NOT NULL COMMENT '交易说明',
  `PAY_ACCOUNT` varchar(50) DEFAULT NULL COMMENT '支付帐号',
  `RECEIVE_ACCOUNT` varchar(50) NOT NULL COMMENT '收款账号',
  `TRADE_BALANCE` double(10,2) NOT NULL COMMENT '交易金额',
  `PAYWAY_ID` int(10) NOT NULL COMMENT '支付通道',
  `BIZ_EXTENDS_PARAMS` int(10) DEFAULT NULL COMMENT '业务扩展参数',
  `PAY_DEAL_STATUS` int(4) NOT NULL COMMENT '处理状态 1待处理，2-处理成功，3-处理失败',
  `PAY_RESULT` int(4) DEFAULT NULL COMMENT '处理结果 1 支付成功  2 支付失败',
  `PAY_NOTICE_STATUS` int(11) DEFAULT '3' COMMENT '通知状态：1）通知成功，2）通知失败，3）通知未送达',
  `PAY_NOTICE_COUNT` int(11) DEFAULT '0' COMMENT '交易结果通知次数',
  `TRADE_TIME` datetime DEFAULT NULL COMMENT '交易时间',
  PRIMARY KEY (`RECORDS_ID`),
  UNIQUE KEY `UK1` (`OPT_SN`)
) ENGINE=InnoDB AUTO_INCREMENT=736 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of bcsupg_pay_records
-- ----------------------------

