-- Table structure for `bcsupg_pay_result_notice_log`
-- ----------------------------
DROP TABLE IF EXISTS `bcsupg_pay_result_notice_log`;
CREATE TABLE `bcsupg_pay_result_notice_log` (
  `LOG_ID` int(10) NOT NULL COMMENT '编号',
  `OPT_SN` varchar(80) NOT NULL COMMENT '流水号',
  `MSG_BODY_CONTENT` varchar(50) NOT NULL COMMENT '消息体内容',
  `ACCEPT_TIME` datetime NOT NULL COMMENT '接受时间',
  PRIMARY KEY (`LOG_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

