-- Table structure for `bcsupg_service_interface`
-- ----------------------------
DROP TABLE IF EXISTS `bcsupg_service_interface`;
CREATE TABLE `bcsupg_service_interface` (
  `SERVICE_ID` int(10) NOT NULL AUTO_INCREMENT COMMENT '服务标识',
  `SERVICE_NAME` varchar(255) NOT NULL COMMENT '服务名称',
  `PAYWAY_ID` int(10) NOT NULL COMMENT '支付通道',
  `INTERFACE_MODEL` int(4) NOT NULL COMMENT '接口模式：1）后台模式，2）前台模式',
  `PAY_RESULT_PROCESS_CLASS` varchar(255) NOT NULL COMMENT '交易结果处理类',
  `STATUS` int(4) NOT NULL COMMENT '接口状态：1）有效，2）无效，99）注销',
  PRIMARY KEY (`SERVICE_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1023 DEFAULT CHARSET=utf8 COMMENT='支付服务接口信息';

